import React from 'react';
import './SubJect.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';

// Width draw SubJect component
export default function REturnSuBJect() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 React.useEffect(() => {
  TweenMax.from('.wrp-subject-withdraw', 1.2, { delay: .6, opacity: 0, y: 20, ease: Expo.easeIn });

 }, []);

 return (
  <div className='wrp-subject-withdraw'>
   <p>lorem Sélectionnez la collection que vous souhaitez supprimer.</p>
  </div>
 )
}
export const ScreenSmall = () => {

 React.useEffect(() => {
  TweenMax.from('.wrp-subject-withdraw-sm', 1.2, { delay: .6, opacity: 0, y: 20, ease: Expo.easeIn });

 }, []);

 return (
  <div className='wrp-subject-withdraw-sm'>
   <p>lorem Sélectionnez la collection que vous souhaitez supprimer.</p>
  </div>
 );
}
